You can create fully declarative VMs by directly defining their nixos system configuration in-place. This is very similar to how nixos-containers work if you are familiar with those. # microvm refers to microvm.nixosModules
{ microvm, ... }: { imports = [ microvm.host ]; microvm.vms = { my-microvm = { # The package set to use for the microvm. This also determines the microvm's architecture. # Defaults to the host system's package set if not given. pkgs = import nixpkgs { system = "x86_64-linux"; }; # (Optional) A set of special arguments to be passed to the MicroVM's NixOS modules. #specialArgs = {}; # The configuration for the MicroVM. # Multiple definitions will be merged as expected. config = { # It is highly recommended to share the host's nix-store # with the VMs to prevent building huge images. microvm.shares = [{ source = "/nix/store"; mountPoint = "/nix/.ro-store"; tag = "ro-store"; proto = "virtiofs"; }]; # Any other configuration for your MicroVM # [...] }; }; };
}

