To add MicroVM functionality, a NixOS system configuration is augmented by importing this flake's nixosModule.microvm: # Example flake.nix
{ inputs.nixpkgs.url = "github:nixos/nixpkgs/nixos-unstable"; inputs.microvm.url = "github:astro/microvm.nix"; inputs.microvm.inputs.nixpkgs.follows = "nixpkgs"; outputs = { self, nixpkgs, microvm }: { # Example nixosConfigurations entry nixosConfigurations.my-microvm = nixpkgs.lib.nixosSystem { system = "x86_64-linux"; modules = [ # Include the microvm module microvm.nixosModules.microvm # Add more modules here { networking.hostName = "my-microvm"; microvm.hypervisor = "cloud-hypervisor"; } ]; }; };
} To get you started quickly, a Flake template is included. Run nix flake init -t github:astro/microvm.nix in a new project directory.

